(1, 'Shepherds Bush Health', '108 Goldhawk Road,', 'info@privatewalkinclinic.com', '0208 746 0830', 'Health', '<h1 style=\"font-size: 30px; margin-top: 0px; margin-bottom: 35px; padding: 0px; font-family: Raleway, sans-serif; color: rgb(35, 40, 42); text-transform: capitalize; line-height: 26px; font-weight: 600; text-align: center;\"><span style=\"color: rgb(153, 51, 0);\"><strong>Welcome To Shepherds Bush Walk-In Clinic</strong></span></h1><p style=\"padding: 0px; color: rgb(156, 156, 156); line-height: 26px; font-family: Poppins, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">We are an independent Healthcare provider regulated and inspected by the Care Quality Commission.&nbsp;</span></p><p style=\"padding: 0px; color: rgb(156, 156, 156); line-height: 26px; font-family: Poppins, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">The focus of the clinic is patient-centered care. Providing excellence in healthcare at your convenience and tailored to your specific needs.&nbsp; Most of our services are available on a same-day appointment and walk-in basis. You will see an experienced doctor who will take their time, discuss your condition with you and inform you about your treatment options.&nbsp; Prescriptions and referrals if required are part of the service you receive.</span></p><p style=\"padding: 0px; color: rgb(156, 156, 156); line-height: 26px; font-family: Poppins, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">â€‹Our doctors are all bilingual, and some even speak more than 4 languages (English, Arabic, Somali, Italian, etc.&nbsp;just name a few.)</span></p><p style=\"padding: 0px; color: rgb(156, 156, 156); line-height: 26px; font-family: Poppins, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">By offering private health-care 24/7 to your doorway as well as in our modern clinic, we promise to provide highly efficient private medical service.</span></p><p style=\"padding: 0px; color: rgb(156, 156, 156); line-height: 26px; font-family: Poppins, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">SomDoc Walk-in Clinic&nbsp;doctors have variety of laboratory assessments along with GP consultation so we can provide our patients with an accurate examination of various medical concerns.</span></p><p style=\"padding: 0px; color: rgb(156, 156, 156); line-height: 26px; font-family: Poppins, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\">Our clinic is run by a dedicated and knowledgeable team who are trained with a strong focus on patient care, patient communication, discretion, and efficiency. When you contact our clinics, you should expect to speak to someone with excellent communication skills who will be able to confidently handle your queries.</span></p>', 'company_logo/7hAWcYnzjQFrakAuGFvHlUN4SwfDAVUxonGw6TYX.jpeg', 1, 1, NULL, NULL, NULL, 550, '2019-09-09 13:53:11', '2020-02-17 01:21:14', '7286ce4c-9681-472d-a48f-441030ae8d7a'),
