(99, 0, 'control for Abdominal pain', '<p>I have seen 2 week ago for dyspeptic&nbsp; &nbsp;symptoms.</p><p>He performed Blood test for H pyloric and Abdominal&nbsp; ultrasound.</p><p>Result</p><p>Negative for H pyloric</p><p>Abdominal ultrasound - normal ( see attach)</p><p>Impression</p><p>&nbsp;Dyspeptic syndrome</p><p>Treatment</p><p>Domperidone 10 mg 1 tablet twice a day ( before food)</p><p>Spasmomem Somatic 40 mg 1 tablet twice a day&nbsp; ( after food).</p><p>Today he report has stopped treatment after 3 day due vomiting and abdominal pain, and he is taking Omoprazole&nbsp; 20 mg&nbsp; whit improvement the symptoms.</p><p><br></p><p>Plan</p><p>From tomorrow I advice to take the triple medicines ( domperidone- Spasmomen somatico - Omeprazole), and if he complains against same symptoms, he can stop to take domperidone- Spasmomen.</p><p>Than he continua Omeprazole one month.</p><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 215, 1, 17, '2019-10-21 13:23:51', '2019-10-21 13:23:51'),
(100, 0, 'Pelvic pain', '<p>Pelvic pain after miscarrage on 15/08/19.</p><p>She had transvaginal ultrasound on 15/10/19 that showed&nbsp; small cycts on left ovary.&nbsp;</p><p>LMP: 05/09/19&nbsp;</p><p>G2/P0,&nbsp; 2 early miscarriages&nbsp; in a year.</p><p>She tells me that she did pregnacy test that showed negative.</p><p><br></p>', 'Nil', 'Nil', '<p>No smoking</p><p>No alcohol;</p><p>She lives with her husband.</p>', 'Nil', 'NKDA', '<p>The abdomen was soft and non tender.No abnormalities&nbsp; noted on inspection of the vagina.The uterus was retroverted and normale size. No masses were noted in the adnexa.</p>', NULL, '<p>Plan: FBC , biochemistry, vitamin D level, proclatin.</p><p>&nbsp;Review with results.</p>', 160, 1, 12, '2019-10-21 13:49:27', '2019-10-21 13:49:27'),
