(4, '{\"history\":{\"medical_history\":\"No\",\"medical_histories\":[],\"accident_history\":\"No\",\"accident_histories\":[]},\"otherInjuries\":[],\"admin\":{\"gpRecord\":\"No\",\"hospitalRecords\":\"No\",\"rehabilitationRecords\":\"No\",\"agreementOfReport\":\"I confirm that the factual content of this report has been read and agreed by the client.\",\"medcoId\":\"\",\"dateOfReport\":\"\",\"accompaniedBy\":\"The client was unaccompanied at this assessment.\",\"caseRef\":\"\",\"dateOfExam\":\"\",\"durationOfExamination\":\"15 minutes.\",\"placeOfExam\":\"\",\"instructingPartyRef\":\"\",\"primaryReferrerName\":\"\"},\"topics\":[],\"claimant\":{\"title\":\"Mr\",\"firstName\":\"\",\"lastName\":\"XXX\",\"domesticStatus\":\"\",\"gender\":\"M\",\"dob\":\"\",\"handed\":\"Right Handed\",\"address\":\"\",\"address2\":\"  \",\"city\":\"\",\"country\":\"United Kingdom\",\"postcode\":\"\",\"job\":\"\",\"id\":\"\",\"jobEductionStatus\":\"Full Time.\",\"sicknessRecord\":\"The client tells me that $he-she$ has always enjoyed good health.\"},\"accident\":{\"time\":\"\",\"vehicleLocation\":\"\",\"after_accident\":\"\",\"sourceImpact\":\"\",\"protection\":\"The vehicle was fitted with air bags and these were properly adjusted and fastened at the time of the accident. The airbag was not activated. The client  was wearing a seatbelt.\",\"impactSeverity\":\"\",\"circumstance\":\"\",\"movement\":\"\",\"position\":\"\",\"vehicleMovement\":\"\",\"directionOfImpact\":\"\",\"speedOfImpact\":\"\",\"vehicle\":\"\",\"date\":\"\"},\"prognosis\":{\"neckOpinion\":\"In my opinion the Claimant\'s symptoms are related to a soft tissue, whiplash injury affecting the neck region. On the balance of probability they are attributable to the accident. This injury involves muscles and ligaments. There is no evidence of any damage to nerves, vertebrae, or spinal cord.\",\"prognosis\":\"8 months\",\"neckReportFromSpecialist\":\"I do not believe a report is required from a specialist from any other medical discipline.\",\"lowerBackReportFromSpecialist\":\"I do not believe a report is required from a specialist from any other medical discipline.\",\"anxietyTreatment\":\"Having assessed the client, I do not believe that any additional treatments are necessary for the described psychological signs and symptoms.\",\"anxityReportFromSpecialist\":\"No additional reports are required at this time.\",\"backPainTreatment\":\"I would recommend a course of physiotherapy, the number of sessions to be determined by the practitioner following assessment. The reasoning for this recommendation is to facilitate recovery.\",\"neckTreatment\":\"I would recommend a course of physiotherapy, the number of sessions to be determined by the practitioner following assessment. The reasoning for this recommendation is to facilitate recovery.\",\"anxietyOpinion\":\"On the balance of probability the psychological symptoms from which the Claimant is suffering are related to the events of the accident. They do not represent Post Traumatic Stress Disorder.\",\"backPainOpinion\":\"In my opinion the Claimant\'s symptoms are related to a soft tissue injury affecting the lumbar spine. On the balance of probability they are attributable to the accident. This injury involves muscles and ligaments. There is no evidence of any damage to nerves, vertebrae, or spinal cord or cauda equina.\"},\"backPainOpinion\":\"In my opinion the claimant\'s symptoms are related to a soft tissue injury affecting the lumbar spine. On the balance of probability they are attributable to the accident. This injury involves muscles and ligaments. There is no evidence of any damage to nerves, vertebrae, or spinal cord or cauda equina.\",\"backPainDuration\":\"8 months\",\"anxietyOpinion\":\"On the balance of probability the psychological symptoms from which the claimant is suffering are related to the events of the accident. They do not represent Post Traumatic Stress Disorder.\",\"anxietyDuration\":\"6 months\",\"anxietyTreatment\":\"Already in progress\",\"neckPrognosis\":\"6 months\",\"effects\":{\"totalTimeOff\":\"\",\"workStudy\":[],\"domesticDuties\":[],\"sportsFitness\":\"regular (once or twice each week)\",\"sleepPattern\":\"a good sleeper\",\"sleepPatternAtWorst\":\"40%\",\"sportsFitnessAtWorst\":\"0%\",\"sportsFitnessAtCurrent\":\"0%\",\"sleepPatternCurrent\":\"80%\",\"specificSportingActivities\":\"Keep fit/home exercise\",\"lightDuties\":\"\",\"lightDutiesCountType\":\"2 Weeks\",\"additionalEffects\":\"\"},\"treatment\":{\"hospitalVisits\":\"None.\",\"hospital\":\"\",\"rehabProvider\":\"\",\"medication\":\"Painkillers and self-home care.\",\"homeExercise\":\"The Claimant has not been given any home exercises.\",\"immediateTreatment\":\"I understand $he-she$ did not receive any treatment at the scene of the incident\",\"treatmentDescription\":\"Whilst I have not been provided with the claimant\'s medical records to confirm or refute these claims, the above history appears to be consistent with the nature and extent of the claimant\'s injuries.\",\"aeVisits\":\"None\",\"consultantVisits\":\"None\",\"primaryCareVisits\":\"None.\",\"furtherTreatment\":\"None.\"},\"future\":{\"diffcultiesHousehold\":\"Ongoing\",\"diffcultiesDomestic\":\"\",\"diffcultiesWorkStudies\":\"\",\"investigations\":\"I do not believe any investigation is required to substantiate the conclusions reached in this report.\",\"longTermSequelae\":\"I do not expect there to be any long term medical sequelae as a direct result of the material incident.\",\"jobProspects\":\"I would not expect the injuries sustained in the accident to have any future affect on the claimant\'s job prospects.\",\"otherComments\":\"In my opinion and on the balance of probabilities, I would confirm that the incapacities claimed, treatments received and consequential losses described are consistent with the index accident.\"},\"guidelineSessions\":\"8\",\"provider\":\"Physiotherapist\",\"recomendation\":\"I would recommend a course of XXX driving lessons.\",\"jobProspects\":\"I would not expect the injuries sustained in the accident to have any future affect on the claimant\'s education or job prospects.\",\"investigations\":\"I do not believe any investigation is required to substantiate the conclusions reached in this report.\",\"longTermSequelae\":\"I do not expect there to be any long term medical sequelae as a direct result of the material incident.\",\"otherComments\":\"Additional medical evidence may be required if any of the Claimant\'s symptoms, attributed to the accident, do not resolve in line with my stated prognosis.\",\"neck\":{\"painStiffness\":\"Yes\",\"symptoms\":\"\",\"onsetDaysAfter\":\"Immediately.\",\"pastMedicalHistory\":\"The claimant states that there is no significant history of neck pain prior to the accident.\",\"description\":\"\",\"intensity\":\"\",\"neurologicalSequalae\":[],\"headache\":\"The Claimant did not suffer from any significant headaches associated with their neck injury.\",\"reportFromSpecialist\":\"I do not believe a report is required from a specialist from any other medical discipline.\"},\"examination\":{\"general\":\"The claimant was well presented and co operative.\",\"sagittalFlexionExtension\":110,\"rightLateralRotation\":70,\"neck\":{\"value\":\"\",\"settings\":{\"sfe\":\"\",\"rlr\":\"\",\"rlf\":\"\",\"llr\":\"\",\"llf\":\"\"}},\"leftLateralRotation\":70,\"leftLateralFlexion\":40,\"psychological\":\"The Claimant appeared well adjusted. There were no signs of any overt psychological or psychiatric illness.\",\"back\":\"Examination revealed a moderate restriction in movement due to pain at the limits of movement.\",\"occupantOfVehicle\":\"Yes\",\"softTissueInjury\":\"Yes\",\"rightLateralFlexion\":40},\"anxity\":{\"symptoms\":\"No\",\"intensity\":2,\"manifestAs\":[],\"description\":\"The claimant has been a nervous driver since the accident. This has not prevented driving but makes him/her a great deal more wary.\",\"onsetDaysAfter\":\"Immediately\",\"symptomsDescription\":\"Travel anxiety.\",\"pastMedicalHx\":\"The claimant states that there is no significant history of mental illnesses prior to the accident.\"},\"lowerBack\":{\"symptoms\":\"Pain and stiffness in the lower back.\",\"painStiffness\":\"Yes\",\"pastMedicalHistory\":\"The claimant states that there is no significant history of lower back pain prior to the accident.\",\"intensity\":\"\",\"description\":\"The Claimant describes central back pain, made worse by prolonged standing, sitting and especially painful when bending and lifting.\",\"onsetDaysAfter\":\"Immediately.\",\"neurologicalSequalae\":[]},\"description\":\"The claimant describes central back pain, made worse by prolonged standing, sitting and especially painful when bending and lifting.\",\"intensity\":2,\"complications\":\"Headache\",\"reportFromSpecialist\":\"Aggravation of pre-existing thoracic spondylosis - symptomatic - not treated prior to accident\",\"additionalTreatment\":\"Having assessed the client, I would recommend physiotherapy treatment for this injury. The number of sessions is to be recommended by the treating practioner. The reasoning for this recommendation is to facilitate recovery.\"}', 1, '2020-04-01 07:19:42', '2020-04-01 07:19:42');
