l&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Current positions: Gastroenterologist<br></span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">NHS &amp; Private GP<br></span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">GP Trainer<br></span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Expert Witness<br></span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">ParaDoc Deputy Clinical Lead<br></span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Shepherds Bush Health Centre Clinical Lead<br></span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Honorary Lecturer</span><br></p>', '<p><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">I am a GMC revalidated doctor based in London and have been preparing expert medico-legal reports for use in personal injury claims since 2014. I take pride in providing quality medico-legal reports, thoroughly documenting the injuries sustained, the effects that these have had on the Claimant and containing a clear discussion of attributability, any appropriate treatment and the likely prognosis. I am MedCo approved - as a Direct Medical Expert - to carry out reports for occupants of motor vehicles who have \'soft tissue claims\'. I can be found on MedCo by searching Direct Medical Expert and choosing General Practitioner/Doctor. My clinics are located in and around London.</span><br></p>', '<p><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">I have been practising in health service for over 20 years and I am in active clinical practice as a Gastroenterologist seeing patients on a regular basis. These patients include holiday sickness cases and I have a special interest and experience in the diagnosis and management of patients with gut infection and inflammatory bowel diseases. I obtained a Level 3 award in Supervising Food Safety in Catering. This food hygiene course covered food poisoning &amp; food borne infection, food hygiene law, design of food premises and Hazard Analysis Critical Control Point (HACCP). I undertake medico-legal work as an independent expert and I have experience with both Claimant and Defence reports. I understand Part 35 of the Civil Procedure Rules and I attended a refreshment course in Nov 2017 where I received CPR Part 35 certificate by Bond Solon. I published on the gut infection topic in some of the leading peer reviewed journals in the world such as Gut and Digestive &amp; Liver Disease.</span><br></p>', 'doctor/signature/H1PmkaPYMIm4IfLCl2HVGaVVSonQ5ss1WAevS76Q.png', 3, 3, NULL, 2, NULL, '$2y$10$oHpflpAFiNUiugZ14I.hDetJ95yY.UALuo.uD1q4YsGVUBWX9Wkai', 'p2OzgaXpjFkKpeFUXH539yKyi3ca2cHuGMWlQYSTx1Qqqf2OMRZYgVKbaKH8', '2020-04-01 03:24:04', '2020-04-01 03:40:28', NULL);
